import React from 'react';
import {Link} from 'react-router-dom'

class ButtonSignIn extends React.Component {
  state = {
    loginFinal: "",
    passwordFinal: ""
  }
  signIn = event => {
    this.setState ({loginFinal: this.props.login, passwordFinal: this.props.password})
    console.log(this.state.loginFinal)
  }
  render () {
    return (
      <div className="buttonLayout">
        <button className="linkSignIn" onClick={this.state.signIn}>
          Вход
        </button>
      </div>
    )
  }
}

export default ButtonSignIn
